// SPDX-License-Identifier: MIT
pragma solidity >=0.6.12 <0.9.0;

contract multiploCinco {
    uint256 public x;

    constructor() {
        x = 5;
    }

    // Retorna la suma de x y 5
    function mulCin() public view returns (uint256) {
        return (x + 5);
    }

    // Incrementa x por el resultado de mulCin
    function gen() public {
        x += mulCin();
    }
}

